const Button =  ({color ='#333' , text='texts'}) => {

    return {
        type:'button',
        props:{
            className :'btn',
            children:{
                type : 'em',
                props: {
                    children : text
                }
            }
        }
    }
}

export default class Test extends Component
{
    render(){
        return (
            <div>
            {Button()}
            </div>

        );
    }
}
